function App() {
  let i = 3;
  let tasks = {
      0 : {
        title : 'Call to ...',
        done : false
      },
      1 : {
        title : 'Call to ..1',
        done : false
      },
      2 : {
        title : 'Call to ..2',
        done : false
      },
  }
  function Create(task) {
    const obj = {title:task, done:false};
    tasks = {...tasks, 3:obj};
    console.log(tasks);
  }

  return (
    <div>
      <CreateTask create = {Create}></CreateTask>
      <div>{tasks[1]}</div>
    </div>

  );
}

export default App;
